const ImageEdit = ({ Images, OnDelete }) => {
  const Images_Show = Array.from(Images).map((Element, index) => {
    return <img className="ui large image" key={index} src={Element} />;
  });
  return <div>{Images_Show}</div>;
};
export default ImageEdit;
